    onSearch = () => {
        console.log("search")
    }

    // onSearch = value => console.log(value);

    render() {
        return (
            <div>
                <PageHeader
                    className="site-page-header"
                    title="站点管理"
                    subTitle={<Link to="/add" style={{ marginLeft: '20px' }}>新增</Link>}
                />
                <Search style={{width:'50px'}} placeholder="名称、首字母、简拼" onSearch={this.onSearch} enterButton />
            </div>
        )
    }
}
